import classes from './Item.module.css'
import Input from "./Input";
const Items = (props) =>{

   
    return(
        <div>
   <ul>
    {props.onSendData.map((item, index) =>{
     return <li id={index} className={classes.list}>{item.name} -  {item.description} - {item.price} 
     <Input/>
       </li>
     })}
   </ul>
        </div>
    )

}

export default Items
